DesignInterventionModelDescription:
We allocate 24 participants into 3 group, low-dose, medium-dose and high-dose group. It is going to proceeded sequential from low-dose group to high-dose group. Next group is allowed to be started only the last group has been finished.

Low-dose group: 100mL human umbilical cord mesenchymal stem cell preparation, containing 2.5×10^7 cells;
medium-dose group: 100mL human umbilical cord mesenchymal stem cell preparation, containing 5.0×10^7 cells;
High-dose group: 100mL human umbilical cord mesenchymal stem cell preparation, containing 1.0×10^8 cells
